function shuffleArray(array) {
  for (let i = array.length - 1; i > 0; i--) {
    // \u968F\u673A\u9009\u62E9\u4E00\u4E2A\u4F4D\u4E8E\u5F53\u524D\u4F4D\u7F6E\u4E4B\u524D\uFF08\u5305\u62EC\u5F53\u524D\u4F4D\u7F6E\uFF09\u7684\u6570\u7EC4\u5143\u7D20\u7D22\u5F15
    const j = Math.floor(Math.random() * (i + 1));
    // \u4EA4\u6362\u5F53\u524D\u4F4D\u7F6Ei\u548C\u968F\u673A\u4F4D\u7F6Ej\u7684\u5143\u7D20
    [array[i], array[j]] = [array[j], array[i]];
  }
  return array;
}
