export const removeElement: RemoveElement = (nums, val) => {
  if (nums.length === 0) {
    return 0;
  }

  let slow = 0,
    fast = 0;

  while (fast < nums.length) {
    if (nums[fast] !== val) {
      nums[slow] = nums[fast];
      slow++;
    }

    fast++;
  }

  return slow;
};

